sys_variable_value.value:
(function execute(inputs, outputs) {
	var utils = new AzureAutomationUtils();
    utils.validateInputVariables(inputs, outputs);
    utils.validateMandatoryVariables(inputs, ['subscription_id', 'resource_group_name','account_name','configuration_name','node_id']);
    utils.mapToOutputFromInput(inputs, outputs, ['subscription_id', 'resource_group_name','account_name','node_id']);
  	var payload = {};
  	payload.nodeId = inputs.node_id;
  	var properties = {};
  	var nodeConfiguration = {};
    nodeConfiguration.name = inputs.configuration_name;
  	properties.nodeConfiguration = nodeConfiguration;
  	payload.properties = properties;
  	outputs.payload = JSON.stringify(payload);	
})(inputs, outputs);

